import React from 'react';
import styled from 'styled-components';

const ContainerStyled = styled.div`
    paddingTop: 20, 
    top: 20%, 
    left: 40%, 
    position: absolute, 
    paddingBottom: 20,
    background-color: white
`;

export function Container({
    children
}) {
    return <ContainerStyled>{children}</ContainerStyled>
}
